import React, {Component} from 'react';

class Main extends Component{
    constructor(props){
        super(props);
        this.state = {
            title: "Menu Makanan"
        }
    }

    rubahData(){
        this.setState({title: "Pilih Makanan"});
    }

    render(){
        return(
            <div>
                <h3>{this.state.title}</h3>
                <button onClick={this.rubahData}>Rubah Data</button>
            </div>
        )
    }
}

export default Main;
